import React, { Component } from 'react'
import {Menu} from "semantic-ui-react"
import UserPanel from "../userPanel/userpanel"
import "../landingPage/index.css"
import Channels from "../channels/Channels"
import DirectMessages from "../directMessages/directMessages"

 class sidePanel extends Component {

    render() {
        return (



            <Menu size="large" inverted fixed="left" vertical style={{background: '#607d8b', fontSize: '1.2rem'}}>

            <UserPanel authenticatedUser={this.props.authenticatedUser} />
            <br/>
            <Channels authenticatedUser={this.props.authenticatedUser}/>
            <DirectMessages user={this.props.authenticatedUser}/>

         </Menu>

        )
    }
}



export default sidePanel
